    "2013-03-14T19:48:16.860329",nt"name": "kansas-road-centerline-fle-krcf",nt"isopen":
    false,nt"url": null,nt"notes": "This version of the Kansas Road Centerline
    File (0801) represents the first effort to create a statewide roads layer from best
    available data sources. KGS integrated linework from 19 counties into the KDOT All
    Roads layer and created a new attribute schema for the merged dataset. Attributes
    were standardized to the US Postal Service Addressing Standard (Pub 28, July 2006)
    where possible. Address attributes are complete as per the source data but other
    ancillary attributes, such as road functional class and road surface, are not yet
    standardized or populated (see Attribute Information for details). The following
    county datasets have been incorporated into KRCF0801: Allen, Anderson, Barton, Bourbon,
    Brown, Crawford, Douglas, Gove, Edwards, Jackson, Logan, Pawnee, Riley, Scott, Sedgwick,
    Stafford, Thomas, Wabaunsee, Wilson.",nt"license_title": null,nt"extras":
